import React from "react";

export default function Register() {
  return (
    <>
      <div className="register-container">
        <div className="register-image"></div>
        <div className="register-form">
          <form action="">
            <label htmlFor="email">Email</label>
          </form>
        </div>
      </div>
    </>
  );
}
